description:
Flattens a deeply nested object to a map of dot-separated
paths pointing to all primitive values **and arrays**
from `rootValue`.

example:
  getFlattenedObject({ a: { b: 1, c: [2,3] } })
  // => { 'a.b': 1, 'a.c': [2,3] }

signature:
({
  promise,
  timeoutMs,
}: { promise: Promise<T>; timeoutMs: number; }) => Promise<{ timedout: true; } | { timedout: false; value: T; }>
